import React, { useEffect, useState } from "react";
import {
  FlatList,
  Button,
  Text,
  View,
  StyleSheet,
  ActivityIndicator,
  Image,
} from "react-native";
import { LinearGradient } from "expo-linear-gradient";
import Spinner from "react-native-loading-spinner-overlay";
// import TestsResults from '../assets/TestsResults.json';
import * as data from "../assets/TestsResults.json";
import { useSelector } from "react-redux";
import {
  LineChart,
  BarChart,
  PieChart,
  ProgressChart,
  ContributionGraph,
  StackedBarChart,
} from "react-native-chart-kit";

import { Dimensions, TouchableHighlight, TouchableOpacity } from "react-native";

export default function WaterTestingScreen({ navigation }) {
  const userName = useSelector((state) => state.initialReducer.user);
  // const [isLoading, setLoading] = useState(true);
  // const [data, setData] = useState([]);
  // console.log(data);

  // useEffect(() => {
  //   fetch(TestsResults)
  //     .then((response) => response.json())
  //     .then((json) => setData(json))
  //     .catch((error) => console.error(error))
  //     .finally(() => setLoading(false));
  // }, []);

  // const dataPie = {
  //   labels: [,"pH", "Temp", "Turbidity","Conductivity"], // optional
  //   data: [,(data.value_params.ph*7.14)/100, data.value_params.temp/100, (data.value_params.turbidity*2)/100, (data.value_params.conduct*2)/100]
  // };

  //   const dataPie = {
  //     labels: [,"pH", "Temp", "Turbidity","Conductivity"], // optional
  //     data: [,data.ph, data.temp, data.turbidity, data.conductivity]
  //   };

  const [currentDate, setCurrentDate] = useState("");
  const [currentMonth, setCurrentMonth] = useState("");
  const [currentImg, setCurrentImg] = useState("");

  useEffect(() => {
    var monthNames = [
      "JAN",
      "FEB",
      "MAR",
      "APR",
      "MAY",
      "JUN",
      "JUL",
      "AUG",
      "SEP",
      "OCT",
      "NOV",
      "DEC",
    ];
    var date = new Date().getDate(); //Current Date
    var month = monthNames[new Date().getMonth()]; //Current Month
    // var year = new Date().getFullYear(); //Current Year
    // var hours = new Date().getHours(); //Current Hours
    // var min = new Date().getMinutes(); //Current Minutes
    // var sec = new Date().getSeconds(); //Current Seconds
    setCurrentDate(date);
    setCurrentMonth(month);
  }, []);

  const [people, setPeople] = useState([
    { name: "iufr", key: "1", pin: "Excellent" },
    { name: "dscs", key: "2", pin: "Bad" },
    { name: "dvs", key: "3", pin: "Normal" },
    { name: "iudsvdsfr", key: "4", pin: "Excellent" },
    { name: "dsvds", key: "5", pin: "Excellent" },
  ]);

  const getImagePin = (pinColor) => {
    if (pinColor == "Excellent") {
      return require("../assets/location-pin-green.png");
    }
    if (pinColor == "Normal") {
      return require("../assets/location-pin.png");
    }
    if (pinColor == "Poor") {
      return require("../assets/location-pin-red.png");
    }
    if (pinColor == "Very Poor") {
      return require("../assets/location-pin-red.png");
    }
  };

  const [isLoading, setLoding] = useState(true);
  const [data, setData] = useState([]);
  const [title, setTitle] = useState([]);
  const [loading, setLoading] = useState(false);
  const [description, setDescription] = useState([]);
  console.log(data);

  useEffect(() => {
    getUserDetails();
  }, [userName]);

  const getUserDetails = () => {
    fetch(TestsResults)
      .then((response) => response.json())
      .then((json) => setData(json))
      .catch((error) => console.error(error))
      .finally(() => setLoading(false));
  };

  return (
    <View style={{ flex: 1, padding: 0 }}>
      {/* {isLoading ? <Text>Loading...</Text> :  */}
      <View
        style={{
          flex: 1,
          flexDirection: "column",
          justifyContent: "space-between",
        }}
      >
        <View style={styles.headContainer}>
          <LinearGradient
            // Button Linear Gradient
            colors={["#EEF2FF", "#ffffff"]}
            start={{ x: 1, y: 1 }}
            end={{ x: 0, y: 1 }}
            style={styles.headContent}
          >
            <TouchableOpacity onPress={() => navigation.navigate("Dashboard")}>
              <Image
                source={require("../assets/back-arrow-blue.png")}
                style={styles.BackArrow}
              />
            </TouchableOpacity>

            <Text style={styles.HeadText}>Quality test</Text>
            <Text style={styles.HeadTextCap}>Water quality results</Text>
            <Image
              source={require("../assets/location-pin-dark-blue.png")}
              style={styles.CalendarImg}
            />
          </LinearGradient>
        </View>

        <View style={styles.StatusContainer}>
          <LinearGradient
            // Button Linear Gradient
            colors={["#EEF2FF", "#ffffff"]}
            start={{ x: 1, y: 1 }}
            end={{ x: 0, y: 1 }}
            style={styles.headContent}
          >
            {/* ***************************index list */}

            {/* <FlatList
                  keyExtractor ={(item) => item.id}
                  data = {people}
                  renderItem={({item}) => (
                    <View style = {styles.previousContainer}>
                        <Image source={require('../assets/select-arrow-blue.png')} style = {styles.SelectArrow} /> 
                        <Text style={styles.slctCntnrTxt}>Previous results</Text>
                        <Text style={styles.slctCntnrTxtCap}>{item.name}</Text>
                        {getImagePin(item.pin)}
                        <Image source={imgUrl} style = {styles.locatioPin} />
                    </View>
                  )}
                  
                  /> */}
            <FlatList
              data={data.results}
              // renderItem={({ item }) => <Text>{item.title}esfeefe</Text>}
